def countDivisors(n):
    """"""
    count = 0
    for i in range(1, n + 1):
        divisor = True
        num = i
        while num:
            digit = num % 10
            if digit != 0 and n % digit != 0:
                divisor = False
                break
            num = num // 10
        if divisor and n % i == 0:
            count += 1
    return count
